    String Result = ""; 
    int times = Math.min(a.length(), b.length()); 

    for (int i = 0; i < times; i++)
    {
        String strA = Character.toString(a.charAt(i);
        String strB = Character.toString(b.charAt(i);

        Result = Result.concat(strA);
        Result = Result.concat(strB);
        a.replaceFirst(strA, ""); 
        b.replaceFirst(strB, "");  
    }

    return Result; 


}

