    int value = -1;

    for (int i = 0; i < nums.length; i++)
    {
        input = nums[i];

        if (input % 10 == 0 && input > value)
        {
            value = input;
        }

        if (value == -1)
        {
            result[i] = input;
        }
        else
        {
            result[i] = value;
        }
    }

    return result;
}

